import React from 'react';
import logo from '../static/Logo.jpg';


function Navbar() {
    return (
        <div>
            <nav>
                <a className = "flex flex-jc-sb">
                    <img src = {logo}></img>
                </a>
            </nav>
        </div>
    )
}

export default Navbar;
